/**
 * Created by edvinmodigh on 2019-01-23.
 */
import React, {Component} from 'react';

import {logoutUser} from './Login'


export default class App extends Component {


    render() {
        const user = this.props.user

        return (
            <div>
                <nav class="navbar navbar-default">
                    <div class="container-fluid">
                        <div class="navbar-header">
                            <a class="navbar-brand" href="#">Tentahelper</a>
                        </div>
                        <ul class="nav navbar-nav">
                            <li class="active"><a >Home</a></li>
                            <li><a href="/">Page 1</a></li>
                            <li><a href="/">Page 2</a></li>
                            <li><a href="/">Page 3</a></li>
                        </ul>
                        <ul class="nav navbar-nav navbar-right">
                            <li><a href="/"><span class="glyphicon glyphicon-user"></span> Sign Up</a></li>
                            <li><button class="btn btn-warning" style="padding-top: 10px " onClick={() => {
                                logoutUser()
                            }}><span class="glyphicon glyphicon-log-out"></span> Sign Out</button></li>
                        </ul>
                    </div>
                </nav>

                Hej {user.displayName}
                <button onClick={() => {
                    logoutUser()
                }} type="button" class="btn btn-warning">Logout
                </button>
            </div>
        )

    }
}
